import React from 'react';
import './App.css';

function App() {

	const API_KEY = `91a00bed4607b32dc90c7ff92b4cddbc`;

	const onButtonSearch = () => {
		fetch(`https://samples.openweathermap.org/data/2.5/forecast?q=München,DE&appid=${API_KEY}`)
		.then(response => console.log(response))
	}

	return (
	<div className="App">
	  <h1>Weather App</h1>
	  <input name="City Search" type="text" placeholder="Enter City"/>
	  <button onClick = {() => {
	  	onButtonSearch()
	  }
	  }>Search</button>
	</div>
	);
}

export default App;
